DROP TABLE IF EXISTS buffs;
CREATE TABLE buffs (
	id INT NOT NULL PRIMARY KEY UNIQUE,
	nano_id INT,
	disc_id INT,
	use_id INT,
	name VARCHAR(255),
	ncu INT,
	nanocost INT,
	school INT,
	strain INT,
	duration INT,
	attack INT,
	recharge INT,
	`range` INT,
	initskill INT,
	froob_friendly BOOLEAN
);
CREATE INDEX idx_buffs_nano_id ON buffs(nano_id);
